        review: "The Birth of a Nation was one of my most anticipated movies of this year. It won the Grand Jury prize in Sundance, and it tells the story of the failed slave rebellion led by Nat Turner. Everything about this movie that could have been interesting was instead constrained to convention. The score, which was fantastically simple yet powerful in the trailers leading up to the film was instead boring, and it overpowered many of the film's scenes. It came off as very clich√©d when it instead could have been excellent. The characters in this movie were bland and uninteresting. In fact, I didn't care about a single one of them, which is a huge insult to a movie about slaves and the struggles they went through. The movie took a character as interesting and complex as Nat Turner, a man who was probably both insane and inspiring, and turned him into an everyday, bland man who just got a little too upset. The lead up to the movies climactic rebellion was decent. Nothing too interesting happened but, like the rest of the film, there wasn't too much to hate about it, The rebellion itself was also uninteresting and generic. Again the score was too loud and bombastic, and again Nate Parker's direction for these scenes showed his inexperience and his fear to break any convention and boundaries. Overall I was extremely disappointed by this film (more than maybe any other film this year) and I would say its one of the most average films of the year. Instead go watch the short film 'Possession' for a better depiction of Nat and 'Gangs of New York' if you want to see what this film's action scenes should have been like.",
